import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(){
    super();

    this.state = {
      monsters: []
    }
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map(monster => {
          return <h1>{monster.name}</h1>
        })}
      </div>
    );
  }
}

export default App;
